import React from "react";
import './UserList.css'


const UserList = () => {
    const users = [
        {
            key: '01',
            name: 'Alan',
            age: 31
        }
    ]
    
    return (
        <ul className="UsersList__">
            <li>Alan  (31 years old)</li>
            <li>Max  (34 years old)</li>
            <li>Julia  (28 years old)</li>
        </ul>
    )
}

export default UserList
